import React, { useState } from "react";
import s from "./style.module.scss";
import {
  useGetData,
  //   usePostData,
  //   useEditData,
  //   useDeleteData,
} from "../../../axios/hooks";
import DeleProduct from "../deleteProduct/deleteProduct";
import EditProduct from "../EditProduct/editProduct";
import PostProduct from "../PostProduct/postProduct";

export default function GetProduct() {
  const [idd, setId] = useState("");
  const {
    data: products,
    isLoading,
    isError,
  } = useGetData(["products"], `/products`);

  // console.log(products);
  if (isLoading) {
    return <p>is Loading</p>;
  }
  return (
    <div>
      <h1>sdfa</h1>
      {/* <PostProduct />
      <EditProduct />
      <DeleProduct /> */}
      {products?.data?.map((e) => {
        return (
          <div key={e.id}>
            <div>
              <div className={s.card}>
                <div className={s.btns} onClick={() => setId(e.id)}>
                  <PostProduct id={idd} />
                  <EditProduct id={idd} />
                  <DeleProduct id={idd} />
                </div>
                <h2>ProductId</h2> {e.id}
                <h2>Gender</h2> {e.gender}
                <h2>NameRU</h2> {e.name_Ru}
                <h2>RUd</h2> {e.description_Ru}
                <h2>CategID</h2> {e.categoryId}
              </div>
            </div>
          </div>
        );
      })}
    </div>
  );
}
